full_text:
Il governo parla di #PNRR ma: 
⛔sparito il ministro dell’innovazione tecnologica (Missione 1 PNRR);
⛔transizione ecologica (M2) e mobilità sostenibile (M3) evaporate;
⛔tagli su istruzione, ricerca e sanità (M4 e M6);
⛔addio all'inclusione sociale con abolizione del #rdc (M5)

